import React from "react";

const style = {
  zIndex: 2000
};

class PortfolioItemDetailModal extends React.Component {
  render() {
    console.log(this.props.modalName);
    return (
      <div class="col-lg-2 text-center">
        <div class="temp">
          <h1 id="current-temp-0">
            <span></span>
          </h1>
        </div>
        <h id="feels-like-0"></h>
        <br />
        <h id="humidity-0"></h>
        <br />
        <h id="uv-index-0"></h>
        <br />
        <div class="row" id="row_wind_arrow">
          <div id="col-arrow">
            <img id="arrow-0" src="" alt="" />
          </div>
          <div id="col-wind">
            <h id="wind-0"></h>
          </div>
        </div>
        <div class="date">
          <h id="clander-date-0"></h>
          <h id="clock-time-0"> </h>
        </div>
      </div>
    );
  }
}

export default PortfolioItemDetailModal;
